import importer from './index';

/**
 * CLI importer.
 */
export default importer();

import path from 'path';
import uniqueConcat from 'unique-concat';

import defaultOptions from './lib/default-options';
import FilterImporter from './lib/filter-importer';

/**
 * Filter importer for node-sass.
 *
 * @param {Object} customOptions
 *   Custom configuration options.
 * @return {Object|null}
 *   Contents object or null.
 */
export default (customOptions = {}) => function importer(url, prev) {
  const options = Object.assign({}, defaultOptions, customOptions);
  const nodeSassIncludePaths = this.options.includePaths.split(path.delimiter);

  if (path.isAbsolute(prev)) nodeSassIncludePaths.push(path.dirname(prev));
  options.includePaths = uniqueConcat(options.includePaths, nodeSassIncludePaths)
    .filter(item => item.length);

  const filterImporter = new FilterImporter(options);
  return filterImporter.resolveSync(url);
};

/**
 * Clean an import url from filters.
 *
 * @param {String} url
 *   Import url from node-sass.
 * @return {String}
 *   Cleaned up node-sass import url.
 */
export default function cleanImportUrl(url = ``) {
  const cleanUrl = url
    .split(`from`)
    .reverse()[0]
    .trim();

  return cleanUrl;
}

/**
 * Extract import filters from a string.
 *
 * @param {String} string
 *   A string that may contains import filters.
 * @return {Array}
 *   Array of found import filters.
 */
export default function extractImportFilters(string = ``) {
  const filterMatch = string.match(/\[([\s\S]*)]/);

  if (filterMatch && filterMatch[1]) {
    return filterMatch[1].split(`,`).map(item => item.trim());
  }

  return [];
}

import CssNodeExtract from 'css-node-extract';
import fs from 'fs';
import path from 'path';
import postcssSyntax from 'postcss-scss';

import cleanImportUrl from './clean-import-url';
import defaultOptions from './default-options';
import extractImportFilters from './extract-import-filters';

/**
 * Import only certain CSS elements form a file.
 */
export default class FilterImporter {
  /**
   * @param {Object} options
   *   Configuration options.
   */
  constructor(options = {}) {
    /** @type {Object} */
    this.options = Object.assign({}, defaultOptions, options);
  }

  /**
   * Extract filters from a file with the given url.
   *
   * @param {String} cleanUrl
   *   Cleaned up node-sass import url.
   * @param {Array} filterNames
   *   Array of filter names.
   * @return {String|null}
   *   Contents string or null.
   */
  extractFilters(cleanUrl, filterNames) {
    if (!filterNames) return null;

    let contents = null;

    this.options.includePaths.some((includePath) => {
      try {
        const css = fs.readFileSync(path.resolve(includePath, cleanUrl), { encoding: `utf8` });
        if (css) {
          contents = CssNodeExtract.processSync({ css, filterNames, postcssSyntax });
          return true;
        }
      } catch (error) {} // eslint-disable-line no-empty
      return false;
    });

    return contents;
  }

  /**
   * Synchronously resolve filtered contents from a file with the given url.
   *
   * @param {String} url
   *   Import url from node-sass.
   * @return {Object|null}
   *   Contents object or null.
   */
  resolveSync(url) {
    const cleanUrl = cleanImportUrl(url);
    const filterNames = extractImportFilters(url);
    const contents = this.extractFilters(cleanUrl, filterNames);

    return contents ? { contents } : null;
  }

  /**
   * Asynchronously resolve filtered contents from a file with the given url.
   *
   * @param {String} url
   *   Import url from node-sass.
   * @return {Promise}
   *   Promise for a contents object.
   */
  resolve(url) {
    return new Promise((promiseResolve) => {
      promiseResolve(this.resolveSync(url));
    });
  }
}

